#Se crea una variable texto
#Almacena los valores
t = """"""

#Variable almacenar치 el mayor valor
kk = 0

#Buscando cuantas variables 
#Cuantas veces sepuede contar 13
#Las adjacent son 13
cv = (len(t)-13)+1

#Variable matem치tica importante de la secuencia
contador = 0

#Bucle for que recorre el texto
for l in range(cv):

    #Cada vez que reinicia el ciclo
    #Se reinicia K
    k = 1

    #Busca de a 13    
    for i in range(13):

        #Convierte el texto a float y multiplica
        k = (float(t[i+contador]))*k

    #Compara el producto m치s grande y lo almacena en kk
    if k>kk:
        kk=k

    
    contador += 1

#Muestra valor m치s grande encontrado
print(kk)